import React from 'react';
import Todo from './Todo';


const TodoList = () => {
    return (
        <div>
            <h1>My Todos</h1>
            <hr></hr>
            <Todo></Todo>
            <Todo></Todo>
            <Todo></Todo>
            <Todo></Todo>
        </div>
  )
}

export default TodoList;
